import React from "react";
import "./Item.css";
import LargeButton from "./LargeButton";

function Item(props)
{
    return(
        <div id="cont">
            <img src={props.src}/>
            <div id="txtContent">
                <p>{props.itemName}</p>
                <p>CATEGORY: {props.itemCategory}</p>
                <p>PRICE: {props.itemPrice}</p>
            </div>
            <LargeButton/>
        </div>
    );
}

export default Item;
